// Os dados da imagem dos colaboradores pareciam estar corrompidos ou inválidos,
// então eu criei este método para substituir a propriedade ["pic"]["data"] retornada pela API
// por imagens base64 válidas.
//
// Isso foi feito apenas para fins de termos o efeito visual esperado,
Future<void> _fixImagesInterceptor(
  Response<dynamic> response,
  ResponseInterceptorHandler handler,
) async {
  if (response.data is List && (response.data.first as Map).containsKey('pic')) {
    final data = response.data as List;
    final newData = data.map((e) {
      e['pic'] = {
        'data': _avatars[math.Random().nextInt(_avatars.length)].codeUnits,
      };
      return e;
    }).toList();
    response.data = newData;
  } else if (response.data is Map && (response.data as Map).containsKey('pic')) {
    final data = response.data as Map;
    data['pic'] = {
      'data': _avatars[math.Random().nextInt(_avatars.length)].codeUnits,
    };
    response.data = data;
  }
  handler.next(response);
}

final _avatars = [
  _avatar,
  _avatar2,
  _avatar3,
  _avatar4,
];

